		text: "My Dearest Anna,\n\nIf you are reading this, then I am already dead.\n\nGood lord, what a cliche. You probably hate that I wrote that. You're probably rolling your eyes. Are they damp, I wonder? After all that's happened, do you have tears left for me?\n\nBut enough of that, I was talking about cliches. I hope you'll forgive that one. I have quite a bit to tell you, things that I'm sorry to say will be confusing and horrible. So, perhaps lingering on a worn out old trope for a moment longer isn't such a bad way to start.\n\nAnd so I'll repeat it, I am dead. And with me I've taken all of my research. I told you many times over the years, when you were still inclined towards asking, that my work was important. That it might well be the most important work any human mind has ever been burdened with. That was true. I've told you so many lies over the years, I beg you to forgive me Anna, but that much was true.\n\nBut now my work is gone. Burned, destroyed, every last hint at my studies has been purged, except for this. I pray that you've found it and only you, that you're reading this, and that not too great a span of time has passed since my death.\n\nWhat I say next, I hope you'll take with the utmost sincerity. Not for the sake of my memory, or the love we once shared (that I still to this day hold for you, whether or not you can believe that), but for the sake of the life of our daughter, which I tell you now hangs in the balance. You must read all I've left here for you. Read it carefully, commit it to heart, and follow my instructions.\n\nThis partition contains a series of files that I've left for you. You must inspect them each, carefully and in order. Some are only text, the rest are a selection of recordings, experimental data. After viewing each you will be given a key that will allow you to open the next.\n\nI'll leave you now to view the next file, though it pains me. I've left you ten thousand times before, with less fuss, but I promise you with heartbreak each time. But the truth is we've parted for the final time already.\n\nsample1.jek\n\nbeginning",
