		unlocks: "sample2.jek",
		key: "bliss",
		text: "Hi Anna,\n\nI'm glad you're still reading. I knew you would. You always had such a beautiful and curious mind. I've always loved that about you, even though it was a torment to me in the end. If your mind had been average perhaps I wouldn't have had to tell you so many lies.\n\nBut, oh yes, you're wondering what it was you just saw. That was a colony of the local fungus Paraisaria Pandora, of the family Ophiocordycipitaceae. I found the strain one evening of that first year in the summer house, while examining a slide full of pond water from the yard. I was only making sure the movers hadn't jostled anything out of alignment, but then I thought I'd get to know the local flora so I recorded a time lapse as it metabolized a crumb of an egg salad sandwich.\n\nRemember how that summer we ate egg salad sandwiches? Every day for lunch, it was an egg salad sandwich, for almost 6 weeks. You were pregnant with Lisa and what a strange craving, egg salad sandwiches. Then you gave birth and after that you said they were revolting. I don't think I've eaten an egg salad sandwich since, but the smell of them always brings me back to that summer...\n\nDo you like the name? I came up with it myself. As far as I know Paraisaria Pandora hasn't been recorded by any other human. That may be because it's rare, for all I know it exists solely in our little backyard pond, but more likely it's simply that it's unremarkable. There are millions of uncatalogued samples of aquatic specimen around the world, waiting in cupboards for science to slowly sort them out.\n\nParaisaria Pandora is unremarkable. It should be unremarkable. It's a decomposer, like all fungi. It moves by growth, an opportunistic eater that searches its environment for food, feeding primarily on algae or plant matter suspended in the water. It isn't a threat to anything with a healthy immune system under normal circumstances, no more than any of the other millions of microorganisms swimming in a glass of pond water.\n\nIts only curious trait was the pattern of its growth. As it searched the slide for resources it methodically reached out in one direction and then the next, almost intelligently, until it found something organic to metabolise. And once it did, its growth exploded. The colony expanded as it consumed until the material was gone and in its place the colony had grown into an almost mold perfect copy of the original material.\n\nParaisaria Pandora isn't unique in this trait, although the fidelity of the copy was unusually impressive. The resulting growth matched the structure of the organic material it consumed down the the cellular level. This is ultimately what inspired me to attempt my second experiment with the fungus. I collected a handful of tadpoles from the yard, stunned them in an ethanol bath, and then moved them into a solution containing Paraisaria Pandora.\n\nsample2.jek\n\nopen",
