		key: "frozen",
		text: "I left the tadpoles on my desk in the basement and then promptly forgot about them. The house was still a mess and we were in a frenzy getting everything ready for the baby.\n\nYou had labeled everything so carefully, but the movers had mixed up all our boxes, so whichever one we opened was sure not to have what we were looking for and to launch a roving hunt all through the house. One night you caught me in the hall with an aquarium full of books under one arm and a dvd player under the other and asked me what I was doing. I told you I was making a cup of coffee of course and you laughed so hard I had to drop it all to help you down to the floor.\n\nDuring the day I was settling in at the university and you were painting Lisa's room blue. That was when we still thought she was going to be a boy. From her very first day she was defying expectations.\n\nA week had passed before I thought about my little experiment again and found a spare moment to go check on it. In the dim light of the basement the jar of water had taken on a mossy green. I set it under a light and peered in. I could see the wriggling shadows of a handful of healthy tadpoles. They had apparently survived their ethanol bath and been too resilient to succumb to fungal infection. There were also a few motionless shadows, floating about at mid depth in the jar.\n\nI took a spoon and fished one of the motionless tadpoles onto a paper plate with a spoon and held it under the light. It was a dull green and covered with a wisp of fuzz. I prodded it and it broke apart, revealing a fibrous interior of uniform texture. It was at that moment I realized it wasn't a tadpole at all, but the remains of a fungal colony that had consumed a tadpole and taken on its exact shape. The tadpole had likely died quickly after being moved, providing a defenceless meal for the fungus. The detail was amazing, the colony perfectly mimicked the shape of a tadpole, down to the contours of it eyes and nostrils and the tiny filaments lining its mouth.\n\nSample3.jek\n\nstronger",
