		name: "conclusions.txt",
		unlocks: "sample4.jek",
		text: "I feel I must pause my story here, because at this point a conclusion may be forming in your mind, one that may find support among the notions and prejudices against me you may have formed over the years, and this is a very dangerous thing because I assure you whatever assumptions you are drawing at this point cannot possibly approach the truth, and as I wrote previously your full understanding and belief of our situation is a matter of life and death.\n\nSo I'll declare now, hopefully before the thought has caught indelible in your mind, that these small morbid experiments with tadpoles in our basement do not amount to the life's work that has stolen us from each other. I did not cloister myself away, neglecting you and Lisa as I did for decades, and yes I'll admit that that's what I've done, in order to develop some macabre form of living taxidermy. I am not mad. More important than anything else, I need you to believe that.\n\nAs you continue to read I'll provide you what proof I can that what I'm telling you is true. I've saved some scraps that I hope will lend more weight than words alone can. But for now the proof I offer is to ask you to remember back to that summer. To the time we spent together. To the moments we shared as we welcomed our baby daughter into the world.\n\nThese memories are the clearest I have, the ones I've cherished the most. I've spent countless hours examining them, turning them over like tattered photographs in my mind, alone in our basement, you and Lisa just upstairs but impossibly distant. I've lived a life accumulating few more and none as joyful. I hope you've bothered to hold onto these memories, that you can still remember us the way we were then.\n\nI can spark your memory if i must. We were deeply in love. We were the center of each other's universes. And then Lisa arrived and we orbited her together. I read aloud to you both while she gurgled in your arms. You painted me asleep with her on my chest, both of us drooling. We changed diapers and warmed bottles and repainted the nursery pink but then kept the crib in our bedroom anyways. We fretted over her first cold, and every time she cried, and one night I raced her to the doctor's office when her nose bled only to be sent home with a box of tissues.\n\nI was not a man obsessed. I was there with you. We should have had more time like that, we deserved it.\n\nsample4.jek\n\nspark",
