		key: "mass",
		text: "I'll return now to the tadpoles, reluctantly, because they do still have their part to play. I've spent so much time rehearsing the telling of this story. Sitting here at my desk, desperate to spill it out to you, while you read or paint or do I truly do not know what just a couple flights of stairs away. But instead I trudge upstairs long after you're asleep to lay wordlessly beside you. I'd rather linger longer telling the happier parts of this story, those are the parts I retell to myself on nights like these, when I can barely restrain myself from rushing upstairs and spilling it all out to you in person, a final cathartic confession in the days before my death.\n\nI wanted to tell you everything, know that. But I couldn't. Not before everything was in place. And by then it was too late.\n\nBut back to the tadpoles.\n\nDespite everything else, I did find time to repeat my tadpole experiment. Not because of any morbid fascination with the furry green bodies that resulted, but because of something strange I noticed one afternoon while penning a letter at my desk. I sat down to write, affording a quick glance to the blurry wriggling shapes in the jar under the light, and then set to work. When I looked up again, what could have been only 10 or 20 minutes later, I saw something peculiar. Every single tadpole that had moments ago been alive had risen motionless to the surface of the water.\n\nI grabbed the jar and inspected it more closely. The floating bodies were completely untouched by the fungus, their skin was still shiny and dappled. One or two twitched. I scanned the murky water and confirmed that not a single living tadpole continued to wriggle around in its depths. In a span of only a few minutes, every one of them had died.\n\nI could have chalked it up to coincidence and assumed that the tadpoles had died because of the subpar environment a jar in a basement provides. However, I had been feeding them a sliver of lettuce now and then when I thought of it, and they had all survived this long. For them to all expire at once seemed extremely unlikely.\n\nI performed the experiment 3 more times. Each time about half of the tadpoles died immediately and were consumed by my growing sample of Paraisaria Pandora, forming ghostly green simulacrum of tadpoles that floated in the cloudy water. The other half of the tadpoles survived unaffected, until exactly 26 days, 18 hours, and between 20 and 40 minutes later, at which point every remaining tadpole died simultaneously.\n\nsample5.jek\n\nmass",
