		type: "text",
		name: "inside.txt",
		text: "The startling consistency of the phenomenon established, I couldn't resist investigating further. The evening of the conclusion of the 4th experiment I put Lisa to bed, waited until you were asleep, and then crept down to the basement with a monitor so that I could examine the freshly deceased tadpoles in privacy before the Paraisaria Pandora consumed them entirely.\n\nI fished out the small slimy corpses and laid them out lengthwise on a section of cardboard. The members of the previous rounds I had packed and sealed in our large box freezer, and now I retrieved them as well, arranging them directly below my desk lamp to thaw.\n\nThe tadpoles were of the species Lithobates palustris, the offspring of the dark spotted pickerel frogs that kept you awake so many nights that first summer with their incessant calling. I'd borrowed a reference from the university and laid it open beside me before thumbing to the page I'd marked.\n\nI began by rinsing a tadpole with distilled water and inspecting its exterior. It appeared perfectly normal, with no visible sign of fungal infection. Next I made a shallow ventral incision and pinned it, spread open, to the cardboard. I wasn't sure what I expected to see. The diagram I had available was only sufficient to identify the species and its major organs, not to determine cause of death.\n\nBut I had already attempted all other avenues to explanation. I ruled out deoxygenation or toxic buildup in the jar when I tried migrating new tadpoles to the same water after a mass die off and they thrived. I ruled out the environment of the basement as the killer by keeping an uninfected jar of tadpoles alive for over 40 days. Tadpoles uncompromised by an ethanol bath also thrived in the infected water, failing to die off on schedule. And so, the only explanation was that the colony was able to affect some physiological change on the weakened tadpoles, one that only managed to kill them after an incubation time of almost a month.\n\nI observed the swirl of intestines, the pale tissue that formed the precursor to lungs, a tiny heart that twitched intermittently. I began to doubt that I'd be able to find any visible evidence of what killed the creature. But then, as I lengthened the incision to the anterior, the scalpel suddenly released a small discharge of rust colored goo, mottled with a crumbled greenish material.\n\nI smeared a small portion of the material on a slide. Under the microscope it was clear that the material was the remains of tissue destroyed by an infection of Paraisaria Pandora. I rinsed the specimen and inspected the void where the liquified tissue had been. It seemed the colony had managed to gain a foothold in the soft tissue of the tadpole's gills, eating them away and killing it by asphyxiation.\n\nSample6.jek\n\nbreathless",
