		text: "I euthanized the remaining tadpoles. The phenomenon was fascinating, but the mystery had been solved, and I found myself developing an uncomfortable empathy for the doomed creatures, a persistent scratching in my throat whenever I thought of them. So I dumped the contents of the jars back into the pond and sterilized my workstation. On a last minute impulse I sealed a sample of Paraisaria Pandora in a plastic bag and stored it away in the freezer. I had an associate in mind who might be interested in it for a future paper.\n\nAnd then I forgot about it. Our lives were full, and I deemed the experiment too grisly for dinner conversation, so I never even mentioned it to you. Life went on, happily.\n\nsample8.jek\n\nover",
