		text: "I didn't go back to sleep that night. I sat on the porch with Lisa, swatting at my thoughts like biting flies, until the croaking of the frogs gave way to the birdsong of morning. Then I climbed our stairs and tucked Lisa into the crib in our bedroom. I could tell you were awake, but you didn't speak and neither did I.\n\nI made coffee, but you didn't come downstairs. I tried to watch tv but I couldn't make sense of the conversations on the screen. Finally I rose and grabbed my keys off the counter. As I passed through the kitchen I poured the half carton of milk down the drain.\n\nI returned 40 minutes later with a fresh carton in hand. I might as well have not bothered, as you still hadn't come downstairs. In the back of my truck were five live release rabbit traps.\n\nsample11.jek\n\nrevive",
